import React from 'react';
import {NavLink} from 'react-router-dom';
const Menu = () =>{
    return(
        <>
        <div className="menu_style">
        <NavLink style={{textDecoration:'none',color:'red'}} exact activeClassName="active_class" to='/'>About us</NavLink>
        <NavLink style={{textDecoration:'none',color:'red'}} exact activeClassName="active_class" to='/contact'>Contact us</NavLink>
        </div>
        </>
    )
}

export default Menu;
